  return(
    <BrowserRouter>
      <Routes>
        <Route index element={<LandingPage />} />
        <Route path="Item_id_main_page" element={<NavBarComponent />} />
        <Route path="*" element={<NavBarComponent />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;

